import React from 'react'

const Slots = (props) => {

    function dayToString(day_of_week){
        if (day_of_week == 0){
            return "Sunday"
        }else if (day_of_week == 1){
            return "Monday"
        }else if (day_of_week == 2){
            return "Tuesday"}
        else if (day_of_week == 3){
            return "Wednesday"
        }
    }
    return (
        <div>
            <button>Add Another Time</button>
            {props.slots && props.slots.map(slot =>
            // console.log(slot),
            <div>
                {dayToString(slot.day_of_week)}-{slot.time_of_day}
            </div>    
            // <li key={slot.id}>{slot} </li>
            
            )}
        </div>
    )

}

export default Slots
